import React from 'react';
import {Typography} from '@material-ui/core';
import {Dialog} from '@material-ui/core';


function Job({job}){

    return (
    <div className="job">
        <div>
            <Typography variant='h5' component='h1' >{job.title}</Typography>
            <Typography>{job.company}</Typography>
            <Typography>{job.location}</Typography>
        </div>
        <div>
            <Typography>posted on {job.created_at.split(' ').slice(0,3).join(' ')}</Typography>
        </div>


    </div>
    )

}

export default Job;
